import vase from './images/superb-vase.jpg';
import building from './images/tall-building.jpg';
import slope from './images/slope-and-mountain.jpg';
import skyScraper from './images/sky-scrapers.jpg';
import pinkCurl from './images/pink-curl.jpg';
import bridge from './images/night-in-city.jpg';
import cubes from './images/complex-sorted-cubes.jpg';
import mountain from './images/mountain.jpg';
import aisle from './images/aisle-in-a-house.jpg';


export default function Hero() {
  return (
    <div>
        <div className='hero-container'>
            <div className='col-1'>
                <img src={ vase } alt='vase'/>
            </div>
            <div className='col-2'>
                <img src={ building } alt='building'/>
                <img src={ slope } alt='slope'/>
            </div>
            <div className='col-3'>
                <img src={ skyScraper } alt='sky scraper'/>
                <img src={ pinkCurl } alt='pink curl'/>
            </div>
            <div className='col-4'>
                <img src={ bridge } alt='bridge'/>
                <img src={ cubes } alt='cubes'/>
            </div>
            <div className='col-5'>
                <img src={ mountain } alt='mountain'/>
                <img src={ aisle } alt='aisle'/>
            </div>
        </div>
        <h1>Online Experiences</h1>
        <p>The following list is made of online experiences from our most valuable customers</p>
    </div>
  );
};
